import React from 'react';
import './Home.css';


function Home() {
  return (
    <div className="home-content">
      <img src={logo} alt="Logo" className="logo" /> {/* Ajout du logo */}
      <div className="text-section">
        <p>
          <strong>B</strong>ienvenue sur <strong style={{ color: '#4ECDC4' }}>نبض التطوع</strong>.
          Cette plateforme réunit ceux qui veulent donner de leur temps et ceux qui ont besoin de soutien.
          Ensemble, faisons une réelle différence dans nos communautés.
        </p>
      </div>
    </div>
  );
}

export default Home;
